import React, { useState, useEffect } from 'react';
function DoctorAppoinment() {
    const [details, setDetails] = useState([
        {
            patientId: 1,
            patientName: "Sabari",
            symptom:"fever",
            status: "seen"
        },
        {
            patientId: 2,
            patientName: "Sanjeevi",
            symptom:"cough",
            status: "unseen"
        },
        {
            patientId: 3,
            patientName: "Jagadeesh",
            symptom:"cold",
            status: "unseen"
        }
    ]);
    return (
        <>
            <h1>Today's Appoinment</h1>
            <div>{
                details.map((det,index)=>{
                    return (
                        <p key= {index}>
                         {det.patientId}

                        </p>
                    )
                })


            }
            <table>
                <thead>
                    <th>Slot No</th>
                    <th>Patient Id</th>
                    <th>Patient Name</th>
                    <th>Symptoms</th>
                    <th>Status</th>
                </thead>
            </table>
            </div>
        </>
    );
}

export default DoctorAppoinment;
